from typing import List
class Solution:
    def singleNumbers(self, nums: List[int]) -> List[int]:
        res = 0
        for num in nums:
            res = res ^ num
        div = 1
        while div & res == 0:
            div <<= 1
        a, b = 0, 0
        for num in nums:
            if num & div:
                a ^= num
            else:
                b ^= num
        return [a, b]

